import React, { useState } from 'react';
import { connect } from 'react-redux';
import mapStoreToProps from '../../redux/mapStoreToProps';
import { Grid, Container, Card } from "@material-ui/core";

function AdoptionSection(props) {
  return (
    <Grid container>
      {props.store.animalsReducer.map((animal, i) =>
      <Grid container xs={4} key={i} justify="space-between" alignItems="center">
        <div className='dailyChallengeImageContainer'>
        <Grid item><img src={animal.picture} /></Grid>
        <Grid item>{animal.name}</Grid>
        <Grid item>{animal.age}</Grid>
        <Grid item>{animal.name}</Grid>
        </div>
      </Grid>
      )}
    </Grid>
  );
}

export default connect(mapStoreToProps)(AdoptionSection);
